import {Table} from 'reactstrap';
import React, { Component } from "react";
import { Scrollbars } from 'react-custom-scrollbars';


class List extends Component {
    constructor (props) {
        super(props);
        this.state = {
            repList: []
        }
    }



    render() {
        return (
            <div>
                <Scrollbars style={{height: '100%'}}>
                    <Table borderless id="roomList">
                        <tbody>
                        {
                        this.state.repList.map((item, index) =>
                            <tr className="user-table-row-container" key={index} >
                                <td className="user-container" style={{padding: 5, height: 50}}>
                                    <div className="usernames" style={{color: "#424954"}}>{item.name}</div>
                                </td>
                            </tr>
                        )
                        }
                        </tbody>
                    </Table>
                </Scrollbars>
            </div>
        );
    }
}

export default List;
